import React from "react";
import "./Header.css";
import logo from "../assets/logo.png";

class NavBar extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <ul className={'SubHeader'}>
        <div>
          <img src={logo} />
        </div>
        <li>
          <a>Retail</a>
        </li>
        <li>
          <a>Client Home</a>
        </li>
        <li>
          <a>Appointments</a>
        </li>
        <li>
          <a>Workshops</a>
        </li>
        <li>
          <a>Classes</a>
        </li>
        <li>
          <a>Sign In</a>
        </li>
        <li>
          <a className="active">
            Dashboard
          </a>
        </li>
      </ul>
    );
  }
}

export default NavBar;
